package com.song.cache;/** * description: * author:          song * createDate:      2017/10/21 */public class CacheValue {    /**     * 过期时间，单位：秒     */    private long expireTime = 0;    private Object value;    public CacheValue(Object value) {        this.value = value;    }    public CacheValue() {    }    public long getExpireTime() {        return expireTime;    }    public void setExpireTime(long expireTime) {        this.expireTime = expireTime;    }    public Object getValue() {        return value;    }    public void setValue(Object value) {        this.value = value;    }}